(function() {
  const canvas = document.getElementById('bg');
  const renderer = new THREE.WebGLRenderer({ canvas, alpha:true, antialias:true });
  const scene = new THREE.Scene();
  scene.fog = new THREE.Fog('#000000', 10, 130);

  const camera = new THREE.PerspectiveCamera(60, window.innerWidth/window.innerHeight, 1, 2000);
  camera.position.z = 10;
// --- Sprite scaphandrier ---
const scaphTexture = new THREE.TextureLoader().load('data:image/png;base64,');
const scaphMaterial = new THREE.SpriteMaterial({ map: scaphTexture, transparent: true, opacity: 0.13 });
scaphMaterial.color.setRGB(0.6,0.6,0.6);
const scaphandrier = new THREE.Sprite(scaphMaterial);
scaphandrier.scale.set(1.2, 2, 0.5); // moins large, hauteur 2
scene.add(scaphandrier);


  /* particles */
  const particleCount = 12000;
  const positions = new Float32Array(particleCount*3);
  const velocities = new Float32Array(particleCount*3);

  for (let i=0;i<particleCount;i++) {
    positions[i*3]   = (Math.random()-0.5)*160;
    positions[i*3+1] = -Math.random()*120;
    positions[i*3+2] = (Math.random()-0.5)*160;

    // small random drift velocity
    velocities[i*3]   = (Math.random()-0.5)*0.02;
    velocities[i*3+1] = (Math.random()-0.5)*0.01;
    velocities[i*3+2] = (Math.random()-0.5)*0.02;
  }
  const geometry = new THREE.BufferGeometry();
  geometry.setAttribute('position', new THREE.BufferAttribute(positions, 3));

  const sprite = new THREE.TextureLoader().load('data:image/png;base64,');
  const material = new THREE.PointsMaterial({
    size: 0.45,
    map: sprite,
    transparent: true,
    opacity: 0.19,
    depthWrite: false,
    sizeAttenuation: true,
    color: 0xffffff
  });
  const points = new THREE.Points(geometry, material);
  scene.add(points);

  /* resize */
  function resize() {
    renderer.setSize(window.innerWidth, window.innerHeight);
    camera.aspect = window.innerWidth/window.innerHeight;
    camera.updateProjectionMatrix();
  }
  window.addEventListener('resize', resize); resize();

  /* scroll depth/parallax */
  
function onScroll() {
  const y = window.scrollY || window.pageYOffset;
  camera.position.y = -y * 0.02;
  camera.position.z = 10 + y * 0.006;
  material.opacity = 0.4 + Math.min(y / 4000, 0.25);
  scaphandrier.position.set(0, camera.position.y, camera.position.z - 2);
}
window.addEventListener('scroll', onScroll);
 onScroll();

  /* animation */
  function animate() {
    requestAnimationFrame(animate);

    const pos = geometry.attributes.position.array;
    for (let i=0;i<particleCount;i++) {
      pos[i*3]   += velocities[i*3];
      pos[i*3+1] += velocities[i*3+1];
      pos[i*3+2] += velocities[i*3+2];

      // bounds to keep them around camera
      if(pos[i*3]  > 80 || pos[i*3]  < -80)  velocities[i*3]*=-1;
      if(pos[i*3+1]> 10 || pos[i*3+1]< -120) velocities[i*3+1]*=-1;
      if(pos[i*3+2]> 80 || pos[i*3+2]< -80)  velocities[i*3+2]*=-1;
    }
    geometry.attributes.position.needsUpdate = true;

    
    // lger mouvement de flottement pour le scaphandrier
    const t = performance.now() * 0.001; // secondes
    scaphandrier.position.x = Math.sin(t) * 0.028;
    scaphandrier.rotation.z = Math.sin(t * 0.5) * 0.0055;

    renderer.render(scene,camera);
  }
  animate();
})();

// === VERSION CORRIGE DES EFFETS VISUELS ===

const canvas = document.getElementById('bg');
const ctx = canvas.getContext('2d');
let w = canvas.width = window.innerWidth;
let h = canvas.height = window.innerHeight;

let particles = [];

function createParticle() {
  const typeRand = Math.random();
  const type = typeRand < 0.6 ? 'circle' : (typeRand < 0.85 ? 'ellipse' : 'glow');
  return {
    x: Math.random() * w,
    y: Math.random() * h,
    size: Math.random() * 2 + 1,
    alpha: Math.random() * 0.4 + 0.2,
    speed: Math.random() * 0.4 + 0.2,
    rotation: Math.random() * Math.PI * 2,
    rotationSpeed: (Math.random() - 0.5) * 0.01,
    type
  };
}

for (let i = 0; i < 120; i++) {
  particles.push(createParticle());
}

function drawParticles() {
  ctx.clearRect(0, 0, w, h);
  let scrollOffset = window.scrollY * 0.01;

  for (let p of particles) {
    p.y -= p.speed + scrollOffset;
    p.rotation += p.rotationSpeed;
    if (p.y < -20) {
      p.y = h + 20;
      p.x = Math.random() * w;
    }

    ctx.save();
    ctx.translate(p.x, p.y);

    if (p.type === 'circle') {
      ctx.beginPath();
      ctx.arc(0, 0, p.size, 0, Math.PI * 2);
      ctx.fillStyle = `rgba(255,255,255,${p.alpha})`;
      ctx.fill();
    } else if (p.type === 'ellipse') {
      ctx.rotate(p.rotation);
      ctx.scale(2.5, 0.4); // tirement visible
      ctx.beginPath();
      ctx.arc(0, 0, p.size, 0, Math.PI * 2);
      ctx.fillStyle = `rgba(255,255,255,${p.alpha})`;
      ctx.fill();
    } else if (p.type === 'glow') {
      let radius = p.size * 25;
      let grd = ctx.createRadialGradient(0, 0, 0, 0, 0, radius);
      grd.addColorStop(0, `rgba(255,255,255,${p.alpha * 0.6})`);
      grd.addColorStop(1, 'rgba(255,255,255,0)');
      ctx.fillStyle = grd;
      ctx.fillRect(-radius, -radius, radius * 2, radius * 2);
    }

    ctx.restore();
  }

  requestAnimationFrame(drawParticles);
}

drawParticles();

window.addEventListener('resize', () => {
  w = canvas.width = window.innerWidth;
  h = canvas.height = window.innerHeight;
});